package main
import (
  "bytes"
  "encoding/base64"
  "github.com/computeportal/glui"
)
const (
  cat_data =""
)
var cat = &glui.ImageData{nil, 0, 0}
func load_cat() bool {
  b, err := base64.StdEncoding.DecodeString(cat_data)
  if err != nil {panic(err)}
  buf := bytes.NewBuffer(b)
  data, err := glui.DecodeJPG(buf)
  if err != nil {panic(err)}
  cat.Pix = data.Pix
  cat.W = data.W
  cat.H = data.H
  return true
}
var cat_loaded = load_cat()